public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result + ((nodeId == null) ? 0 : nodeId.hashCode());
  result = prime * result + (int) (totalMemory ^ (totalMemory >>> 32));
  result = prime * result + totalCpus;
  return result;
}
